import React, {Component} from "react";
import '../tabata.css'
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

class Excercice extends Component {
    render() {
        return(
            <div>
                <div className="container-fluid">
                        <div className="w-100 mx-auto">
                                <div className="card">
                                    <Row>
                                        <Col>
                                            <h4 className="card-title">Vueltas:</h4><p>8</p>
                                            <h4 className="card-title">Tiempo de trabajo:</h4><p>60seg</p>
                                        </Col>
                                        <Col>
                                            <h4 className="card-title">Tiempo de descanso:</h4><p>60seg</p>
                                            <h4 className="card-title">Tiempo de espera:</h4><p>10seg</p>
                                        </Col>
                                    </Row>
                                </div>
                        </div>
                    </div>
            </div>
        );
    }
}

export default Excercice;
